  function H2D5RVE1I9P641T5149XP2HWX367X9E645F86B7B0A48B5F2C529F12D1AB5DA996714(post_id){
    var btn = jQuery('#qeditsubmit');
    var btnName = btn.html();
    btn.html('Loading...');
    btn.attr('disabled','true');


    if(post_id==0){
      var post_id = document.getElementById("c_post_id").value;
    }
    var url_status = jQuery("#trtask"+post_id+" .url_status").val();
    if(url_status!=0)return;

    jQuery.ajax({
      type: "GET",
      url: "<?php echo $GP05TRX1O9Y39KR3513HZ08C1DY74O4GECJ15812Y92P67V894G9947MH5Q300K9SQ3ERV370FXLJF6A3AM0VD8Y3Y79GN830U37U9ELO31298655KJ68P4111Q07RCA6C1951E8DB2FD2403CE0191526C16576783; ?>",
      data: "ab=change2fetch&postid="+post_id,
      dataType: "json",
      beforeSend: function(data){
      },
      success: function(data){
        if(data.status==1){
          jQuery("#qchangeModal").removeClass("fade");
          jQuery('#qchangeModal').modal('hide');

          btn.html(btnName);
          btn.removeAttr('disabled');

          jQuery("#trtask"+post_id).removeClass();
          jQuery("#trtask"+post_id).html(data.html);
          jQuery(".ajaxload").hide();
          jQuery(".ajaxload").addClass("info");
          jQuery(".ajaxload").fadeIn(1000,function (){
            jQuery(".ajaxload").removeClass("ajaxload info");
            jQuery("#qchangeModal").addClass("fade");
          });
        }else{
          btn.html(btnName);
